/// <summary>
        ///     Access bit in array.
        /// </summary>
        /// <param name="index">Target bit index.</param>
        public bool this[byte index]
        {
            [MethodImpl(MethodImplOptions.AggressiveInlining)]
            get => (Bits0 & (1 << index)) != 0;

            [MethodImpl(MethodImplOptions.AggressiveInlining)]
            set
            {
                if (value)
                {
                    Bits0 = (ushort)(Bits0 | (1 << index));
                }
                else
                {
                    Bits0 = (ushort)(Bits0 & ~(1 << index));
                }
            }
        }

